    function state_change() {
        var nodes = document.querySelectorAll(".result-node");
        for(var i = 0; i < nodes.length; i++) {
            nodes[i].style.display = "none";

            // 无法满足含 xx 条件
            if(!(filter_stat.pa_only && nodes[i].querySelector('[pa]')) &&
              !(filter_stat.jma_only && nodes[i].querySelector('[jma]')) &&
              !(filter_stat.mma_only && nodes[i].querySelector('[mma]')) &&
              !(filter_stat.me_only && nodes[i].querySelector('[me]')) &&
              (filter_stat.pa_only || filter_stat.jma_only || filter_stat.mma_only || filter_stat.me_only)) {
                continue;
            }

            // 无法满足 rym 条件
            if(filter_stat.rym) {
                var rkn = nodes[i].querySelector('[rank]');
                if(!rkn || rkn.getAttribute("rank") > filter_stat.rym) continue;
            }

            // 无法满足乐队筛选条件
            var mbs = nodes[i].querySelectorAll("[band]");
            var flag = false;
            if(filter_stat.bands.length) {
                for(var j = 0; j < mbs.length; j++) {
                    if(filter_stat.bands.indexOf(mbs[j].getAttribute("band")) >= 0) { flag = true; break; }
                }
                if(!flag) continue;
            }

            // 无法满足乐种筛选条件
            var gs = nodes[i].querySelectorAll("[genre]");
            flag = false;
            if(filter_stat.genres.length) {
                for(j = 0; j < gs.length; j++) {
                    if(filter_stat.genres.indexOf(gs[j].getAttribute("genre")) >= 0) { flag = true; break; }
                }
                if(!flag) continue;
            }

            nodes[i].style.display = "inline-block";
        }
    }

